  false,\n\t\"url\": null,\n\t\"notes\": \"Attempts to stabilize the shore can greatly
  influence rates of shoreline change. Beach nourishment in particular will bias rates
  of observed shoreline change toward accretion or stability, even though the natural
  beach, in the absence of nourishment, would be eroding. Pilkey and Clayton (1990)
  prepared a summary of identifiable beach nourishment projects in the Atlantic Coast
  region. Those records were used to identify shoreline segments that had been influenced
  by beach nourishment. Supplemental information regarding beach nourishment was collected
  from agencies familiar with nourishment projects in the State. All records were
  compiled to create a GIS layer depicting the spatial extents of nourishment projects
  within the State.\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
